  #popover_blogs .tab_notice:after {display:none}
/*  DIV#xkit-control.xkit-help-forwarder > A,*/
.tab_bar .tab.iconic:not(#activity_button) {padding: 0 6.5px}
/*  .tab_bar .iconic A.tab_anchor {*/
.tab.iconic:not(#activity_button) > a.tab_anchor {
	width: 35px;
    background-image: /*url('http://i.imgur.com/dD3zj.png')*/
      url('data:image/png;base64,') !important;
    background-size: 175px 36px;
  }
